import { SignUp } from '@clerk/clerk-react';
import React from 'react';
import './SignUp.css';

const SignUpPage = () => {
  return (
    <div className="sign-up-container">
      <SignUp 
        routing="path" 
        path="/sign-up" 
        signInUrl="/sign-in"
        redirectUrl="/"
        appearance={{
          elements: {
            formButtonPrimary: 'clerk-button',
            card: 'clerk-card',
            headerTitle: 'clerk-title'
          }
        }}
      />
    </div>
  );
};

export default SignUpPage;
